import React from 'react';

const CarList = ({ cars }) => {
  return (
    <div>
      <h1>Available Cars</h1>
      <ul>
        {cars.map((car) => (
          <li key={car.id}>
            {car.name} - {car.timeSlots.join(', ')}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CarList;
